import { useState } from "react";

interface Option{
    id: string;
    text: string;
    correct: boolean;
}
interface Quiz {
    id: number;
    name: string;
    username: string;
}
interface Question {
    count: number,
    quiz_id: number,
    id: number | undefined,
    content: string,
    options: Option[],
}
interface FullQuiz{
    quiz: Quiz,
    questions:Question[]
}
interface Props{
    visible: boolean,
    Quiz: FullQuiz | undefined
    setVisible(visible: boolean): void,
}

export default function QuizPage(props: Props){
    const { visible , Quiz, setVisible} = props
    const [pageCount, setPageCount] = useState(1)
    return(
        <>
            {visible &&
                <div >
                    <div className="">{pageCount} of </div>
                </div>
            }
        </>
    )
}
